@alexiscorbiere Fallait pas appeler a voter pour lui 
Vous avez fait son jeu en demandant à votre électorat de voter en défaveur de marine le Pen.
Aujourd'hui il faut assumer les conséquences

@_C_VIAL Et bien si ! et savez-vous pourquoi ?
Melenchon et les LR ont implicitement fait voter pour lui en rejetant le vote pour Marine Le Pen...
Voilà où nous en sommes des incompétents et des narcisses nous dirigent à coups de 49.3 et tout le monde laisse faire !
